import React from "react";
import "../../Styles/Shared/ShopSecondCard.scss";
import shopSecCard1 from "../../Assets/shopSecCard1.JPG";
import MyButton from "./MyButton";
function ShopSecondCard() {
  return (
    <div className='shopSecondCard'>
      <img src={shopSecCard1} alt='' />
      <p>battle Games 2021 Collection</p>
      <MyButton name='buy now' />
    </div>
  );
}

export default ShopSecondCard;
